[gcode_macro HomeAll]
gcode:
  G28 X Y 
  G0 X150 Y150 
  G28 Z F3000
  CENTER

[gcode_macro HomeAll_Tilt]
gcode:
  G28 X Y 
  G0 X150 Y150
  G28 Z F3000
  CENTER
  Fast_Tilt


[gcode_macro CHOME]
description: Homes XYZ axis only if printer is in a non-homed state
gcode:
  {% if "xyz" not in printer.toolhead.homed_axes %}
    G28
  {% endif %}
    

[idle_timeout]
timeout: 1800

